import React from "react";
import {
    Button,
    Card,
    CardBody,
    CardImage,
    CardTitle,
    CardText,
    Col
} from "mdbreact";

export default class Device extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        console.log(this.props);
        let devices = this.props.devices.map((device, idx) => {
            return (
                <Col key={idx}>
                    <Card style={{ width: "22rem" }}>
                        <CardImage
                            className="img-fluid"
                            src="https://mdbootstrap.com/img/Photos/Others/images/43.jpg"
                            waves
                        />
                        <CardBody>
                            <CardTitle>{device.identifier}</CardTitle>
                            <CardText>
                                Some quick example text to build on the card
                                title and make up the bulk of the card&apos;s
                                content.
                            </CardText>
                            <Button href="#">Button</Button>
                        </CardBody>
                    </Card>
                </Col>
            );
        });

        return <div className="devices-container">{devices}</div>;
    }
}
